import React from "react";
import ReactDOM from "react-dom/client";
import "bootstrap/dist/css/bootstrap.min.css";
import RegistrationForm from "./components/registration-form";
import LoginForm from "./components/login-form";
import NavigationBar from "./components/nav-bar";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  BrowserRouter,
} from "react-router-dom";
import Profile from "./components/profile";
import AccountPage from "./components/AccountComponent/account-page";
import { AccountProvider } from "./components/AccountComponent/account-context";
import TransactionPage from "./components/TransactionComponent/transaction-page";
import { TransactionProvider } from "./components/TransactionComponent/transaction-context";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Router>
        <NavigationBar />
        <Routes>
          <Route path="/login" element={<LoginForm />} />
          <Route path="/register" element={<RegistrationForm />} />
          <Route path="/profile" element={<Profile />} />
          <Route
            path="/accounts"
            element={
              <AccountProvider>
                <AccountPage />
              </AccountProvider>
            }
          />
          <Route
            path="/accounts"
            element={
              <AccountProvider>
                <AccountPage />
              </AccountProvider>
            }
          />
          <Route
            path="/transactions"
            element={
              <TransactionProvider>
                <TransactionPage />
              </TransactionProvider>
            }
          />
        </Routes>
      </Router>
    </BrowserRouter>
  </React.StrictMode>
);
